        """
        :type nums1: List[int]
        :type nums2: List[int]
        :type k: int
        :rtype: List[int]
        """

        def pick(nums, k):
            out = []
            for i, num in enumerate(nums):
                if len(out) < k:
                    if num > out[-1]:
                        out.append(num)
                else:
                    if num > out[-1]:
                        out.pop()
                        out.append(num)
            return out

        def merge(nums1, nums2):
            out = []
            i, j = 0, 0
            while i < len(nums1) and j < len(nums2):
                if nums1[i] > nums2[j]:
                    out.append(nums1[i])
                    i += 1
                else:
                    out.append(nums2[j])
                    j += 1
            out += nums1[i:]
            out += nums2[j:]
            return out

        def max_k_nums(nums, k):
            out = []
            for i in range(len(nums)):
                if len(out) < k:
                    out.append(nums[i])
                else:
                    if nums[i] > out[-1]:
                        out.pop()
                        out.append(nums[i])
            return out

        if len(nums1) < k:
            return merge(nums1, nums2)
        if len(nums2) < k:
            return merge(nums2, nums1)

        nums1_max = pick(nums1, k)
        nums2_max = pick(nums2, k)

        if len(nums1_max) < len(nums2_max):
            return merge(nums2_max, nums1_max)
        else:
