class Solution(object):
    def toHex(self, num):
        """
        :type num: int
        :rtype: str
        """

        if num == 0:
            return "0"

        if num < 0:
            num = 2**32 + num

        hex_dict = {10:"a", 11:"b", 12:"c", 13:"d", 14:"e", 15:"f"}
        hex_list = []

        while num > 0:
            remainder = num % 16
            if remainder < 10:
                hex_list.append(str(remainder))
            else:
                hex_list.append(hex_dict[remainder])
            num = num // 16

        hex_list.reverse()
        return "".join(hex_list)

