class Solution(object):
    def firstUniqChar(self, s):
        """
        :type s: str
        :rtype: int
        """

        # Time Complexity: O(n)
        # Space Complexity: O(1)

        # Hashmap to store the frequency of each character in the string
        freq = {}

        # Iterate through the string and update the frequency of each character
        for char in s:
            if char not in freq:
                freq[char] = 1
            else:
                freq[char] += 1

        # Iterate through the string again and return the first character with a frequency of 1
        for i, char in enumerate(s):
            if freq[char] == 1:
                return i

        # If no character with a frequency of 1 is found, return -1
        return -1

