        s_dict = {}
        for char in s:
            if char not in s_dict:
                s_dict[char] = 1
            else:
                s_dict[char] += 1

        if t_dict == s_dict:
            return s

        left = 0
        right = 0
        min_len = len(s) + 1
        min_left = 0
        min_right = 0
        for right in range(len(s)):
            if s[right] in t_dict:
                if s_dict[s[right]] < t_dict[s[right]]:
                    s_dict[s[right]] += 1
                else:
                    s_dict[s[right]] -= 1

            if self.is_valid(s_dict, t_dict):
                while self.is_valid(s_dict, t_dict):
                    if right - left + 1 < min_len:
                        min_len = right - left + 1
                        min_left = left
                        min_right = right
                    if s[left] in s_dict:
