            visited = set()
            steps = 0
            while q:
                for _ in range(len(q)):
                    x, y = q.pop(0)
                    if (x, y) == end:
                        return steps
                    for dx, dy in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
                        nx, ny = x + dx, y + dy
                        if 0 <= nx < m and 0 <= ny < n and forest[nx][ny] and (nx, ny) not in visited:
                            q.append((nx, ny))
                            visited.add((nx, ny))
                steps += 1
            return -1

        m, n = len(forest), len(forest[0])
        trees = []
        for i in range(m):
            for j in range(n):
                if forest[i][j]:
                    trees.append((forest[i][j], i, j))
        trees.sort()
        start = (0, 0)
        steps = 0
        for height, x, y in trees:
