class Solution(object):
    def generateParenthesis(self, n):
        """
        :type n: int
        :rtype: List[str]
        """

        def backtrack(open_count, close_count, curr_str, res):
            if open_count == close_count == n:
                res.append(curr_str)
                return
            if open_count < n:
                backtrack(open_count + 1, close_count, curr_str + "(", res)
            if close_count < open_count:
                backtrack(open_count, close_count + 1, curr_str + ")", res)

        res = []
        backtrack(0, 0, "", res)
        return res

