class Solution(object):
    def setZeroes(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: None Do not return anything, modify matrix in-place instead.
        """

        # Time Complexity: O(m*n)
        # Space Complexity: O(1)

        # Approach:
        # 1. We will use two variables to keep track of the rows and columns that need to be set to zero.
        # 2. We will iterate through the matrix and keep track of the rows and columns that need to be set to zero.
        # 3. We will iterate through the matrix and set the corresponding row and column to zero if the corresponding row or column needs to be set to zero.
        # 4. We will iterate through the matrix again and set the corresponding row and column to zero if the corresponding row or column needs to be set to zero.
        # 5. We will return the matrix.

        rows = set()
        cols = set()

        for i in range(len(matrix)):
            for j in range(len(matrix[0])):
                if matrix[i][j] == 0:
                    rows.add(i)
                    cols.add(j)

        for i in range(len(matrix)):
            for j in range(len(matrix[0])):
                if i in rows or j in cols:
                    matrix[i][j] = 0

        return matrix

