        :type board: List[List[str]]
        :rtype: None Do not return anything, modify board in-place instead.
        """

        def isValid(board, row, col, num):
            for i in range(9):
                if board[row][i] == num:
                    return False
                if board[i][col] == num:
                    return False
            startRow = row - row % 3
            startCol = col - col % 3
            for i in range(3):
                for j in range(3):
                    if board[startRow + i][startCol + j] == num:
                        return False
